note_models.css:
@font-face {
	font-family: yugothic;
	src: url('_YuGothic-Regular.ttf');
	font-weight: normal;
}
.card {
	font-family: yugothic;
	font-size: 30px;
	text-align: center;
	color: black;
	background-color: white;
}
hr {
	border:0;
	border-top:1px solid silver;
}
.jp {
	font-size: 40px;
}
a {
	color: black;
	text-decoration: none;
}
.i-show {
	display: none;
}
.ipod .i-show, .iphone .i-show, .ipad .i-show {
	display: initial;
}
.ipod .i-hide, .iphone .i-hide, .ipad .i-hide {
	display: none;
}
